import React from 'react';
import { Table } from 'reactstrap';
import { string } from 'yup/lib/locale';
import "./Dictionary.scss";

const mockData = [
  {
    dictionary: "one",
    words: [
      {en: "sail", ua: "плавати"},
      {en: "some", ua: ""},
      {en: "same", ua: "те саме"},
      {en: "case", ua: "випадок"},
      {en: "cause", ua: "причина"},
      {en: "weak", ua: "слабкий"},
      {en: "therefore", ua: "тому"},
      {en: "fluent", ua: "впливати"},
      {en: "introduce", ua: "представляти"},
      {en: "carry out", ua: "продовжуй"},
    ]
  },
  {
    dictionary: "two",
    words: [
      {en: "sail", ua: "плавати"},
      {en: "", ua: ""},
      {en: "", ua: ""},
      {en: "", ua: ""},
      {en: "", ua: ""},
      {en: "", ua: ""},
      {en: "", ua: ""},
      {en: "", ua: ""},
      {en: "", ua: ""},
      {en: "", ua: ""},
    ]
  },
  {
    dictionary: "tree",
    words: [
      {en: "sail", ua: "плавати"},
      {en: "", ua: ""},
      {en: "", ua: ""},
      {en: "", ua: ""},
      {en: "", ua: ""},
      {en: "", ua: ""},
      {en: "", ua: ""},
      {en: "", ua: ""},
      {en: "", ua: ""},
      {en: "", ua: ""},
    ]
  },
];

const Dictionary: React.FC = () => {

  const list = mockData.map((item: any) => {

    const innerList = item.words.map((item: any, idx: number) => {
      return (
        <tr>
          <th scope="row">{ idx }</th>
          <td>{ item.en }</td>
          <td>{ item.ua }</td>
          <td>answer</td>
        </tr>
      )
    })

    return (
      <Table className="table-dictionary-words">
        <thead>
          <tr>
            <th>#</th>
            <th>EN</th>
            <th>UA</th>
            <th>YOUR</th>
          </tr>
        </thead>
        <tbody>
          { innerList }
        </tbody>
      </Table>
    )
  });

  return (
    <div className="dictionary-page">
      <div className="col-9">
        <div className="dictionary-words">
          <div className="dictionary-words__party">
            { list }
          </div>
        </div>
      </div>
      <div className="col-3">
        <div className="dictionary-options">

        </div>
      </div>
    </div>
  )
}

export default Dictionary;
